    this.frames.push(frame);

    frame = new FrameInfo();
    frame.frameNumber = 9;
    frame.scores = [3, 4];
    this.frames.push(frame);

    frame = new FrameInfo();
    frame.frameNumber = 10;
    frame.scores = [3, 4];
    frame.isLastFrame = true;
    this.frames.push(frame);


  }

  calculateScore(): void {
    console.log("calculate score");
  }

}
